// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

///@notice You can use this as helper functions for contracts making use of Admins.

library Admins{
  struct Admin {
    mapping (address => bool) list;
  }

  ///@notice Checks is the given account has the given role.
  function hasAdmin(Admin storage admin, address _account)
    internal
    view
    returns (bool)
  {
    require(_account != address(0), "");
    return admin.list[_account];
  }

  ///@notice Adds the given role to the given account.
  function addAdmin(Admin storage admin, address _account) internal
  {
    require(_account != address(0), "");
    require(!hasAdmin(admin, _account), "Admins: account already has role");

    admin.list[_account] = true;
  }

  ///@notice Removes the given role from the given account.
  function removeAdmin(Admin storage admin, address _account) internal
  {
    require(_account != address(0), "");
    require(hasAdmin(admin, _account), "");

    admin.list[_account] = false;
  }

}
